import React from 'react'

const TableRow = ({row}) => (
  <tr>
    <td key={row.name}>{row.name}</td>
    <td key={row.data}>{row.data}</td>
  </tr>
)

const Table = ({data}) => (
  <table>
    {data.map((row)=>(
      console.log(this)
    ))}
  </table>
)

export default Table
